import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

export default function PostDetail() {

    const {id} = useParams()
    console.log(id)


    useEffect(()=>{
        const fetchDetailPost = async()=>{
            const token = sessionStorage.getItem('accessToken');
            try {
                const res = await fetch(`127.0.0.1:8000/postDetail/:${id}` , {
                    method:"GET",
                    headers: {
                        Authorization: token,
                      },
                })
                const data = await res.json()
                console.log(data)
            } catch (error) {
                console.log(error)
            }


        }
        fetchDetailPost()
    },[])


  return (
    <div>
      This detail card page
    </div>
  )
}
